import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { ThemeProvider } from '@material-ui/core/styles';
import theme from './Components/theme'
ReactDOM.render(
  <React.StrictMode>
  <ThemeProvider theme={theme}>
  <App />
  </ThemeProvider>

  </React.StrictMode>,
  document.getElementById('root')
);
